import React from 'react';
import styled from "styled-components";
import Logo from "../header/images/logo.svg"
import Profile from "../header/images/profile.svg"
import Inventory from "../header/images/inventory.svg"
import Notifications from "../header/images/notifications.svg"
import Tracker from "../header/images/tracker.svg"

const HeaderWrapper = styled.div`
  background-color: #320F0F;
  padding: 5px 15px;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
`;

const RowContainer = styled.div`
  display: flex;
  flex-direction: row;
`;

function Header() {
    return (
        <HeaderWrapper>
            <img src={Logo}/>
            <RowContainer>
                <img src={Tracker}/>
                <div>
                    Investment tracker
                </div>
            </RowContainer>
        </HeaderWrapper>
    );
}

export default Header;
